        string fileName;

        private void Initialization()
        {
            this.fileName = @"D:\Test\BoardData\Altium\ReportStandart.csv";

            if (File.Exists(this.fileName))
                File.Delete(this.fileName);

            string header = "FullName" + ";" + "Name" + ";" + "StandartName" + ";" + "StandartNumber" 
                            + ";" + "StandartJear" + ";" + "Diameter" + ";" + "Longitude" + "\n";
            File.AppendAllText(this.fileName, header, Encoding.UTF8);
        }

        public TestStandart()
        {
            this.Initialization();
            foreach (string onePart in this.standartParts)
            {
                StandartElement stPart = new StandartElement(onePart);
                //string info = stPart.FullName + ";" + stPart.GeneralParameters + "\n";
                string info = stPart.FullName + ";" + stPart.Name + ";" + stPart.NameStandart + ";" + stPart.NumberStandart
                            + ";" + stPart.JearStandart + ";" + stPart.Diametr + ";" + stPart.Length + "\n";
                File.AppendAllText(this.fileName, info);
                Console.WriteLine(info);
            }
        }
